	(619541501440958464,b'1','title','ASC','图书报表','SELECT t_book.id, t_book.title, t_person.name, sys_dict.label \"sexLabel\"\nFROM t_book,\n     t_person LEFT JOIN sys_dict on t_person.sex = sys_dict.name AND type = \'sex\'\nWHERE t_book.person_id = t_person.id\n  AND t_book.title LIKE :title\n  AND t_person.name = :name\n  AND t_person.sex = :sex',NULL,'[{\"name\":\"title\",\"label\":\"书名\",\"sortable\":true,\"hidden\":false,\"align\":\"left\",\"tooltip\":false,\"type\":\"text\"},{\"name\":\"name\",\"label\":\"作者\",\"sortable\":true,\"hidden\":false,\"align\":\"left\",\"tooltip\":false,\"type\":\"text\"},{\"name\":\"sexLabel\",\"label\":\"性别\",\"sortable\":false,\"hidden\":false,\"align\":\"left\",\"tooltip\":false,\"type\":\"text\"}]','[{\"name\":\"title\",\"label\":\"书名\",\"type\":\"TEXT\"},{\"name\":\"name\",\"label\":\"作者\",\"type\":\"TEXT\"},{\"name\":\"sex\",\"label\":\"性别\",\"type\":\"SELECT\",\"extraData\":\"sex\"}]',0,'2022-11-03 12:49:42',0,'2023-09-22 01:18:06',b'0',NULL,NULL,'0001',NULL),
	(668074769748373504,b'1','name','ASC','人员信息表','SELECT t_user.name              AS \"name\",\n#        t_user.gender            AS \"gender\",\n       sd.label AS \"gender\",\n       t_user.age               AS \"age\",\n       t_user.birthday          AS \"birthday\",\n       t_user.mobile            AS \"mobile\",\n       t_user.score            AS \"score\",\n       t_user.email             AS \"email\",\n       t_user.native_place      AS \"nativePlace\",\n       t_user.hobby             AS \"hobbyList\",\n       IF(t_user.marriage, \'是\', \'否\')         AS \"marriage\",\n       t_user.introduce         AS \"introduce\",\n       t_user.attachment        AS \"attachmentList\",\n       t_user.school_experience AS \"schoolExperienceList\",\n       t_user.status            AS \"status\",\n       t_user.create_by        AS \"createdBy\",\n       t_user.create_time        AS \"createdAt\",\n       t_user.update_by        AS \"updatedBy\",\n       t_user.update_time        AS \"updatedAt\",\n       t_user.is_deleted        AS \"deleted\",\n       t_user.id                AS \"id\"\nFROM t_user left JOIN sys_dict sd ON t_user.gender = sd.name WHERE is_deleted = 0 AND t_user.name like :name AND t_user.gender = :gender AND t_user.mobile = :mobile AND t_user.native_place IN (:nativePlace) AND t_user.status = :status AND t_user.hobby like :hobbyList AND t_user.birthday >= :birthday0 AND t_user.birthday <= :birthday1 AND marriage = :marriage','age, score','[{\"name\":\"name\",\"label\":\"姓名\",\"sortable\":true,\"hidden\":false,\"align\":\"left\",\"tooltip\":false,\"type\":\"text\"},{\"name\":\"gender\",\"label\":\"性别\",\"sortable\":false,\"hidden\":false,\"align\":\"left\",\"tooltip\":false,\"type\":\"text\"},{\"name\":\"age\",\"label\":\"年龄\",\"sortable\":false,\"hidden\":false,\"align\":\"left\",\"tooltip\":false,\"type\":\"text\"},{\"name\":\"birthday\",\"label\":\"出生日期\",\"valueConverterNameList\":[\"localDateConverter\"],\"sortable\":true,\"hidden\":false,\"align\":\"left\",\"tooltip\":false,\"type\":\"text\"},{\"name\":\"mobile\",\"label\":\"手机号码\",\"sortable\":false,\"hidden\":false,\"align\":\"left\",\"tooltip\":false,\"type\":\"text\"},{\"name\":\"score\",\"label\":\"得分\",\"sortable\":false,\"hidden\":false,\"align\":\"left\",\"tooltip\":false,\"type\":\"text\"},{\"name\":\"email\",\"label\":\"邮箱\",\"sortable\":false,\"hidden\":false,\"align\":\"left\",\"tooltip\":false,\"type\":\"text\"},{\"name\":\"nativePlace\",\"label\":\"籍贯\",\"sortable\":false,\"hidden\":false,\"align\":\"left\",\"tooltip\":false,\"type\":\"text\"},{\"name\":\"hobbyList\",\"label\":\"兴趣爱好\",\"valueConverterNameList\":[\"arrayDictConverter\"],\"context\":\"hobbyList\",\"sortable\":false,\"hidden\":false,\"align\":\"left\",\"tooltip\":false,\"type\":\"text\"},{\"name\":\"marriage\",\"label\":\"婚否\",\"sortable\":false,\"hidden\":false,\"align\":\"left\",\"tooltip\":false,\"type\":\"text\"},{\"name\":\"introduce\",\"label\":\"自我介绍\",\"sortable\":false,\"hidden\":false,\"align\":\"left\",\"tooltip\":false,\"type\":\"text\"},{\"name\":\"status\",\"label\":\"状态\",\"valueConverterNameList\":[\"dictConverter\"],\"context\":\"status\",\"sortable\":false,\"hidden\":false,\"align\":\"left\",\"tooltip\":false,\"type\":\"text\"}]','[{\"name\":\"name\",\"label\":\"姓名\",\"type\":\"TEXT\"},{\"name\":\"mobile\",\"label\":\"手机号码\",\"type\":\"TEXT\"},{\"name\":\"gender\",\"label\":\"性别\",\"type\":\"SELECT\",\"extraData\":\"gender\"},{\"name\":\"birthday\",\"label\":\"出生日期\",\"type\":\"DATE_RANGE\"},{\"name\":\"nativePlace\",\"label\":\"籍贯\",\"type\":\"MULTIPLE_SELECT\",\"extraData\":\"nativePlace\"},{\"name\":\"hobbyList\",\"label\":\"兴趣爱好\",\"type\":\"SELECT\",\"extraData\":\"hobbyList\"},{\"name\":\"status\",\"label\":\"状态\",\"type\":\"SELECT\",\"extraData\":\"status\"},{\"name\":\"marriage\",\"label\":\"婚否\",\"type\":\"SELECT\",\"extraData\":\"bol\"}]',0,'2023-03-17 11:03:35',0,'2023-09-22 01:17:56',b'0',NULL,NULL,'t_user',NULL);
